import React from 'react';
import logoPlaceholder from '../resources/images/logoPlaceholder.svg';

export const Logo = ({ text }) => {
    return (
        <div className='auth-form-logo-container'>
            <img src={logoPlaceholder} alt="" />
            <span>&{text}</span>
        </div>
    );
};
